description:
Denis has not only one, but two good reasons to be happy... and horny... and those reasons are Katy and Medina. Both are adorable, and sexy, and best of all... horny.... which means they want him as much as he wants them. Luckily for him, he gets to have both of at the same time. He likes watching first as these two sexy gals kiss and caress each other. Before too long though, Medina gets a craving for some opposite energy and decides to bring Denis into the mix. Without objection, he lets Medina lead him to the bed where Katy waits to give him some special attention... as she gets some herself from Medina. As things progress, the passion only increases in this sexy threesome. Come on in and see just how much... enjoy!

